import React from "react";
import "./MainPage.css";
import HashTagTech from "./TechLogo";
function MainPage()
{
    return(
        <div id="content-wrapper">
            <HashTagTech 
                fontSize="100px"
                color="#666666"/>
        </div>
    );
}

export default MainPage;
